window.bookSummaryJSON = "<p>Jane Yellowrock has her hands full in the latest novel in the <i>New York Times</i> best-selling series that captures \"the essence of urban fantasy\" (<i>SF Site</i>). </p> <p>Slaying vampires is child's play for skinwalker Jane Yellowrock. But handling the complicated politics of New Orleans' supernatural players is another story.... </p> <p>Jane is keeping the peace between visiting groups of witches and vamps in the city, but then trouble comes knocking on her door. When her house is magically attacked, the wild chase to find her assailants unearths a mystery that has literally been buried deep. </p> <p>A missing master vampire, presumed long deceased, is found chained in a pit...undead, raving mad, and in the company of two human bodies. Now it's up to Jane to find out who kept the vampire hidden for so long and why, because the incident could tip already high supernatural tensions to an all-out arcane war. </p>"; 
